import React from 'react';


const style_block = {
  display: 'block',
}

const style_flex = {
  display: 'flex',
}

const Inputs_left = () => {

  return (<div style={style_block}>
    <label style={style_block}>Імґʼя<input style={style_block} type="text"></input></label>

    <div style={style_flex}>
      <label style={style_block}>Фамілія<input style={style_block} type="text"></input></label>
      <label style={style_block}>Назва компанії, організації<input style={style_block} type="text"></input></label>
      <label style={style_block}>Email-адрес<input style={style_block} type="text"></input></label>
      <label style={style_block}>Номер телефону<input style={style_block} type="text"></input></label>
    </div>
  </div >
  );

}

export default Inputs_left;
